import './css/webs-done.css';
import SocialDotsHeader from './components/social-dots-header';
import Portada from './components/promo1'


function WebsDone() {
  return (
    <div className="WebsDone">
      <SocialDotsHeader/>

      <Portada
        dir='webs-developed/'
      />    
    </div>    
  );
}

export default WebsDone;
